export function hcl(h, c, l, opacity) {
  return arguments.length === 1
    ? hclConvert(h)
    : new Hcl(h, c, l, opacity == null ? 1 : opacity);
}

export function Hcl(h, c, l, opacity) {
  this.h = +h;
  this.c = +c;
  this.l = +l;
  this.opacity = +opacity;
}

