  brighter: function(k) {
    return new Hcl(
      this.h,
      this.c,
      this.l + K * (k == null ? 1 : k),
      this.opacity
    );
  },
  darker: function(k) {
    return new Hcl(
      this.h,
      this.c,
      this.l - K * (k == null ? 1 : k),
      this.opacity
    );
  },
  rgb: function() {
